import React from "react";
import { connect } from "react-redux";
import { Button, Glyphicon } from "reactstrap";
import { Control, Form, actions } from "react-redux-form";

const ChordArtControl = (props) => {
  return (
    <Form
      model="chord-art"
    >
      <label htmlFor="chord-art.hueCycles">Hue Cycles:</label>
      <Control.text model="chord-art.hueCycles" id="chord-art.hueCycles" />

      <label htmlFor="chord-art.hueOffset">Hue Offset:</label>
      <Control.text model="chord-art.hueOffset" id="chord-art.hueOffset" />

      <label htmlFor="chord-art.lineSpeed">Line Speed:</label>
      <Control.text model="chord-art.lineSpeed" id="chord-art.lineSpeed" />

      <label htmlFor="chord-art.lineThickness">Line Thickness:</label>
      <Control.text model="chord-art.lineThickness" id="chord-art.lineThickness" />

      <label htmlFor="chord-art.lineOpacity">Line Opacity:</label>
      <Control.text model="chord-art.lineOpacity" id="chord-art.lineOpacity" />

      <label htmlFor="chord-art.spanPower">Span Power:</label>
      <Control.text model="chord-art.spanPower" id="chord-art.spanPower" />

      <label htmlFor="chord-art.colorPower">Color Power:</label>
      <Control.text model="chord-art.colorPower" id="chord-art.colorPower" />

    </Form>
  );
};

export default ChordArtControl;
